import './App.css';
import Form from './components/Form'
import Hola from './components/Hola'
import {
	BrowserRouter as Router,
	Switch,
	Route,
	Link
} from 'react-router-dom'

function App() {
  return (
	  <Router>
		  <Switch>
			  <Route path="/inicio">
				  Inicio
			  </Route>
			  <Route path="/form">
				  Formulario
			  </Route>
			  <Route path="/">
				  Principal
			  </Route>
		  </Switch>
	  </Router>
  );
}

export default App;

